This promotional CD showcases the preposterous variety of musical artists performing at One Family Gathering.

ONE FAMILY GATHERING - MAY 2-4 2008, CENTRAL OREGON

    The One Family Gathering will be a three day unity gathering  near Christmas Valley, Oregon. The festival will unify a variety of cultures from many other peaceful gatherings. It will manifest as a weekend long event encompassing barter fairs, music festivals, parties, and reggae shows, surrounded by a free camping area.

     We will provide a large, secure vendor section inside the event in addition to hosting two stages: a \&quot;party\&quot; tent with nonstop djs, hosted by DJ4NORML crew and the \&quot;Quetzalcoatl\&quot; stage. Both stages will have a dynamic array of musicians performing twenty-four hours a day throughout the event. 
Over 90 music performances, a barter fair, a rave, an eco-village, a beer garden, exceptional food vendors, and much more.
